  \"Prehistoric human geography in the Carson Desert : Part I : A predictive model
  of land use in the Stillwater Wildlife Management Area\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 16,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:18:24.658466\",\n\t\"name\": \"prehistoric-human-geography-in-the-carson-desert-part-i-a-predictive-model-of-land-use-in-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes a model that has
  been developed to predict the geographic structure of hunter-gatherer behavior in
  the Great Basin. The distribution of archaeological- sites in the Stillwater Wildlife
  Management Area remains largely unknown, although chance exposure and limited archaeological
  survey suggests that prehistoric human use of the region was more intense than in
  most parts of the western Great Basin. As a prelude to further archaeological research,
  a model is developed herein to predict the probable geographic structure of hunter-gatherer
  behavior in the area, and its probable consequences for the development of an archaeological
  record. The model invokes environmental variability as a principal conditioner of
  foraging behavior, and attempts, through the application of assumptions from optimal
  foraging theory, to relate variation in the spatial and temporal distribution of
  subsistence resources in the Stillwater vicinity to a theoretically effective subsistence
  strategy. The model suggests that in most seasons of most years the marshlands of
  the study area offer a suite of diverse, high-quality, often storable food resources,
  and that prehistoric foragers are likely to have concentrated their subsistence
  efforts there whenever hydrologic conditions supported a marsh ecosystem.\",\n\t\"license_title\":
